    if n == 0 or n == 1:
        return False
    lim = int(math.sqrt(n)) + 1
    for i in range(2, lim):
        if n % i == 0:
            return False
    return True

def nth_term(n):
    c = 0
    prev = 0
    for i in range(2, int(100000.0)):
        if is_prime(i):
            prev = i
            c += 1
        if c == n:
            return prev * n * n

